/*Table structure for table `products` */

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `productid` int(11) NOT NULL AUTO_INCREMENT,
  `productname` varchar(90) DEFAULT NULL,
  `quantity` decimal(10,2) DEFAULT NULL,
  `datesupplied` date DEFAULT NULL,
  `catid` int(11) DEFAULT NULL,
  `vendor` varchar(90) DEFAULT NULL,
  `description` varchar(1024) DEFAULT NULL,
  `costprice` decimal(10,2) DEFAULT NULL,
  `saleprice` decimal(10,2) DEFAULT NULL,
  `productcode` varchar(50) DEFAULT NULL,
  `userid` int(11) DEFAULT NULL,
  `originalquantity` int(11) DEFAULT NULL,
  `unitcost` decimal(10,2) DEFAULT NULL,
  `packprice` decimal(10,2) DEFAULT NULL,
  `pieces` int(11) DEFAULT NULL,
  `stocklimit` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`productid`)
) ENGINE=InnoDB AUTO_INCREMENT=211 DEFAULT CHARSET=utf8mb4;

